    /****
    isNFTOwner Modifier checks wether the NFT exists or not?
    and then checks if the current owner owns the token or not?
    Parameters:
    uint: tokenId
    ****/
    modifier isNFTOwner(uint256 _tokenId) {
        if (_tokenId > 0) {
            require(
                _NFTExists[NFTs[_tokenId - 1]] == true,
                "NFT Doesn't exists.... Create NFT First"
            );
        } else {
            require(
                _NFTExists[NFTs[_tokenId]] == true,
                "NFT Doesn't exists.... Create NFT First"
            );
        }
        //now check if the user has the tokenId...
        bool counter = false;
        uint256[] memory all = viewAllTokens(msg.sender);
        for (uint256 i = 0; i < all.length; i += 1) {
            if (all[i] == _tokenId) {
                counter = true;
            }
        }
        require(counter == true, "Owner doesn't owns the token");
        _;
    }

    /****
    availableToBuy function lists all the NFTs that can be bought. Or list of NFTs that users want to sell
    Returns:
    nftProp[]: which contains the Properties of the NFT.
    uint[]: Contains the token Ids of the NFTs.
    ****/

    function availableToBuy()
        public
        view
        returns (nftProp[] memory, uint256[] memory)
    {
        nftProp[] memory availableToBuyNFTsInformation = new nftProp[](
            forSellArray.length
        );
        uint256[] memory availableToBuyNFTsTokenIds = new uint256[](
            forSellArray.length
        );
        for (uint256 i = 0; i < forSellArray.length; i += 1) {
            //return the nftprop structure for selling.
            availableToBuyNFTsInformation[i] = NFTinfo[forSellArray[i]];
            availableToBuyNFTsTokenIds[i] = forSellArray[i];
        }
        return (availableToBuyNFTsInformation, availableToBuyNFTsTokenIds);
    }

    /****
    Bought mapping is used to check that how many NFT's has been sold.
    Parameters:
    uint: _tokenId id of the token
    bool: true or false
    
    tokenId=>true/false
    ****/
    mapping(uint256 => bool) Bought;

    /****
    addForSell function adds a NFT into marketplace for selling. That is another person can buy that NFT.
    Parameters:
    uint: _tokenId id of the token
    ****/
    function addForSell(uint256 _tokenId) public isNFTOwner(_tokenId) {
        //if it is a non transferrable NFT then it cannot be sold.
        require(getNFTtype(_tokenId) != 4, "Cannot Sell Non Transferable NFT");
        //check if the NFT is listed for selling already?
        require(forSell[_tokenId] == false, "Already Listed For Selling!!");
        forSell[_tokenId] = true;
        forSellArray.push(_tokenId);
    }

    /****
    removeFromSell function removes the NFT from Selling
    Parameters:
    uint: _tokenId id of the token
    ****/
    function removeFromSell(uint256 _tokenId) public isNFTOwner(_tokenId) {
        //first make sure that hte NFT is not bought...
        require(
            Bought[_tokenId] == false,
            "Cannot remove from Selling, NFT is already sold..."
        );
        //now check if it is listed for the sell?
        require(forSell[_tokenId] == true, "NFT is not listed for selling...");
        forSell[_tokenId] = false;
        //now remove the nft from forSellArray too....
        uint256 counter = 0;
        for (uint256 i = 0; i < forSellArray.length; i += 1) {
            //first swap, then pop
            if (forSellArray[i] == _tokenId) {
                counter = i;
                break;
            }
        }
        if (counter != forSellArray.length - 1) {
            //swap
            forSellArray[counter] = forSellArray[forSellArray.length - 1];
            forSellArray.pop();
        }
        //  else {
        //     forSellArray.pop();
        // }
    }

    /****
    buyNFT function is used to buy the NFT. Only those NFTs can be bought which are actually listed for selling.
    Parameters:
    uint: _tokenId id of the token
    ****/
    function buyNFT(uint256 _tokenId) public {
        //check if the current user who is trying to buy is the same one as who listed the NFT for selling.
        require(msg.sender != ownerOf(_tokenId), "You cannot Buy Your Own NFT");
        //check if NFT is already biught or not?
        require(Bought[_tokenId] == false, "NFT Already Bought!!");
        //Check if NFT is available to sell or has it been removed.
        require(forSell[_tokenId] == true, "NFT removed from Selling");
        forSell[_tokenId] = false;
        Bought[_tokenId] = true;
        //now add this nft to user wallet. depending on what type of nft it is.
        //also mark the previous owners mapping,

        address tempUser = ownerOf(_tokenId);
        uint256 num = getNFTtype(_tokenId);
        if (num == 1) {
            //remove from prevouis owner
            uint256[] memory newTokens = removeNFTfromAddress(
                _tokenId,
                tempUser,
                AllSpecialNFT[tempUser]
            );
            //push into new user
            AllSpecialNFT[msg.sender].push(_tokenId);
            //update mapping of old user.
            AllSpecialNFT[tempUser] = newTokens;
        } else if (num == 2) {
            uint256[] memory newTokens = removeNFTfromAddress(
                _tokenId,
                tempUser,
                AllPreLaunchNFT[tempUser]
            );
            AllPreLaunchNFT[msg.sender].push(_tokenId);
            AllPreLaunchNFT[tempUser] = newTokens;
        } else {
            uint256[] memory newTokens = removeNFTfromAddress(
                _tokenId,
                tempUser,
                AllGenericNFT[tempUser]
            );
            AllGenericNFT[msg.sender].push(_tokenId);
            AllGenericNFT[tempUser] = newTokens;
        }

        previousOwners[_tokenId] += 1;

        //after buying the nft it should also be removed from forSell array as the nft is sold......
        bool shouldSwap = false;
        uint256 counter = 0;
        for (uint256 i = 0; i < forSellArray.length; i += 1) {
            //return
            if (forSellArray[i] == _tokenId) {
                counter = i;
                shouldSwap = true;
                break;
            }
        }
        if (shouldSwap) {
            //swap
            forSellArray[counter] = forSellArray[forSellArray.length - 1];
            forSellArray.pop();
        }
    }

    /****
    removeNFTfromAddress function helps in transferring the NFT from one wallet to another and update the mapping in between the process.
    It removes teh NFT From previous owners wallet.
    Parameters:
    uint: _tokenId id of the token
    address: _tempUser address of the previous owner. (FOR CUSTOM CHECK ONLY..... NO USE)
    uint[]: array of the tokens owned by the previous owner.
    Returns:
    uint[]: New modified sized array.
    ****/
    function removeNFTfromAddress(
        uint256 _tokenId,
        address _tempUser,
        uint256[] memory tokensOwned
    ) internal pure returns (uint256[] memory) {
        uint256 counter = 0;
        for (uint256 i = 0; i < tokensOwned.length; i += 1) {
            //first swap, then pop
            if (tokensOwned[i] == _tokenId) {
                counter = i;
                break;
            }
        }
        if (counter != tokensOwned.length - 1) {
            //swap
            tokensOwned[counter] = tokensOwned[tokensOwned.length - 1];
        }
        //then pop
        // delete tokensOwned[counter];
        // tokensOwned.length--;
        shrinkArray(tokensOwned, tokensOwned.length - 1);

        return tokensOwned;
    }

    /****
    shrinkArray function is a special fucntion which is created to change the size of teh array dynamically. 
    It is built so that while working with the arrays and want to reduce size of a particular array, just send the array along with the new size of the array. It will shrink the array from teh last.
    Parameters:
    array and new size of the array
    Returns:
    New modified sized array.


    Because pop function in arrays is giving memory storage issue so created new function.
    ****/
    function shrinkArray(
        uint256[] memory array,
        uint256 newLength
    ) internal pure returns (uint256[] memory) {
        require(
            newLength <= array.length,
            "Array: length after shrinking larger than before"
        );
        /// @solidity memory-safe-assembly
        assembly {
            mstore(array, newLength)
        }
        return array;
    }

    //BURN FUNCTION, NEED TO MODIFY THE STATUS,
    //CHANGE ALL THE OTHER MAPPING AND MAKKE SURE IT DOES NOT CLASHES WITH EXPIREABLE.

    function burnMyToken(uint256 _tokenId, address _off) public returns (bool) {
        require(
            getNFTtype(_tokenId) != 4,
            "Cannot Burn A Non Transferable Token!!"
        );
        if (ownerOf(_tokenId) == _off) {
            _burn(_tokenId);
            return true;
        } else return false;
    }

    // We can do a simple thing, that is we can create a database for the current user only.
    // In this database we will make sure that, it is for this user only and the timestamps.
    // Listed will be checked with what is current time. If the time is passed, then we will
    // Call the blockchain, and do the needful.
    // Otherwise we will not do anything.
    // We will do this so that the number of calls are reduced in the contract.

    //simply call this function recursively whenever page is refreshed....
    //reIssue the NFT for prelaunch. Like once the prelaunch nft timer goes off, then add a new nft based on the specs.
    function reIssueNFTForPreLaunch(address _off) public {
        uint[] memory userOwnedIds = AllPreLaunchNFT[_off];
        for (uint i = 0; i < userOwnedIds.length; i++) {
            if (ifTimeHasPassed(NFTinfo[userOwnedIds[i]].ExpireOn)) {
                //generate a new special nft for the same
                this._Special(
                    NFTs[userOwnedIds[i]],
                    NFTinfo[userOwnedIds[i]].minted,
                    NFTinfo[userOwnedIds[i]].name,
                    NFTinfo[userOwnedIds[i]].description,
                    NFTinfo[userOwnedIds[i]].url,
                    NFTinfo[userOwnedIds[i]].trxnHash,
                    NFTinfo[userOwnedIds[i]].nftType,
                    NFTinfo[userOwnedIds[i]].boughtOn,
                    NFTinfo[userOwnedIds[i]].seller,
                    NFTinfo[userOwnedIds[i]].ExpireOn,
                    _off
                );
                //remove this nft form the prelaunch
                userOwnedIds = removeNFTfromAddress(
                    userOwnedIds[i],
                    address(this),
                    userOwnedIds
                );
                i--;
            }
        }
        AllPreLaunchNFT[_off] = userOwnedIds;
    }
